import React from 'react';
import Navbar from './components/Navbar'; // Assuming Navbar.tsx is in the same directory
import Home from './pages/Home'; // Adjust this import path as necessary
import Game from './pages/Game'; // Adjust this import path as necessary
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

const App: React.FC = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/game" element={<Game />} />
      </Routes>
    </Router>
  );
}

export default App;
